import * as React from 'react';

const Errors = ({ err }) => {
	console.log('i am error', err);
	err.map((error, i) => (
		<p data-test="graphql-error">
			<strong>Shoot!</strong>
			{err.message.replace('GraphQL error: ', '')}
		</p>
	));
};
export default Errors;
